-- ============================================
-- 配置参数
-- ============================================
SET @YEAR = 2099;
SET @MONTH = 9;
SET @WEEK_SEQ = 1;
SET @SUPPLY_ATTRIBUTE = '正常';
SET @URS = 0;

-- 可用区域列表（按客户数从高到低排序）
SET @REGION_1 = '城区';
SET @REGION_2 = '丹江口市';
SET @REGION_3 = '房县';
SET @REGION_4 = '郧阳区';
SET @REGION_5 = '竹山县';
SET @REGION_6 = '郧西县';
SET @REGION_7 = '竹溪县';

-- ============================================
-- 测试用例数据
-- ============================================


-- ============================================
-- 验证插入结果
-- ============================================
SELECT 
    COUNT(*) AS total_cases,
    COUNT(DISTINCT DELIVERY_METHOD) AS delivery_methods,
    COUNT(DISTINCT DELIVERY_ETYPE) AS extension_types,
    COUNT(DISTINCT TAG) AS tags,
    MIN(ADV) AS min_adv,
    MAX(ADV) AS max_adv,
    COUNT(DISTINCT DELIVERY_AREA) AS region_combinations
FROM cigarette_distribution_info
WHERE YEAR = 2099 AND MONTH = 9 AND WEEK_SEQ = 1;

-- ============================================
-- 按投放方式统计
-- ============================================
SELECT 
    DELIVERY_METHOD,
    DELIVERY_ETYPE,
    COUNT(*) AS case_count,
    MIN(ADV) AS min_adv,
    MAX(ADV) AS max_adv
FROM cigarette_distribution_info
WHERE YEAR = 2099 AND MONTH = 9 AND WEEK_SEQ = 1
GROUP BY DELIVERY_METHOD, DELIVERY_ETYPE
ORDER BY DELIVERY_METHOD, DELIVERY_ETYPE;

-- ============================================
-- 按预投放量范围统计
-- ============================================
SELECT 
    CASE 
        WHEN ADV < 1000 THEN '0-1K'
        WHEN ADV < 5000 THEN '1K-5K'
        WHEN ADV < 20000 THEN '5K-20K'
        WHEN ADV < 100000 THEN '20K-100K'
        ELSE '100K-150K'
    END AS adv_range,
    COUNT(*) AS case_count
FROM cigarette_distribution_info
WHERE YEAR = 2099 AND MONTH = 9 AND WEEK_SEQ = 1
GROUP BY adv_range
ORDER BY MIN(ADV);
